import React from 'react';
import styles from '../../styles/components/admin_navbar2.module.scss';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import NavbarBtn from '../layout/NavbarBtn';


const AdminNavbar = () => {
    return (
        <nav className={styles.navbar}>

            <NavbarBtn><FontAwesomeIcon icon="cog" /></NavbarBtn>
            <NavbarBtn><FontAwesomeIcon icon="home" /></NavbarBtn>
            <NavbarBtn><FontAwesomeIcon icon="newspaper" /></NavbarBtn>
            <NavbarBtn><FontAwesomeIcon icon="sign-out-alt" /></NavbarBtn>
        </nav>
    );
}

export default AdminNavbar;
